    <div>
    <p class=MsoNormal align=center style='text-align:center'><u><span
    lang=ES-MX style='font-size:22.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'>Mis motivaciones<o:p></o:p></span></u></p>
    <p class=MsoNormal style='text-align:justify'><span lang=ES-MX
    style='font-size:16.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'>Mis motivaciones son algo sencillas, ya que
    primero mi decisin de estudiar fuera de Pando era algo que tenia que pasar
    si o si, por lo pequea que es la ciudad de ah, adems que me ayudara a
    poder independizarme, pero si es algo complicado estar lejos de tu familia <span
    class=SpellE>mas</span> importante, pero nada de eso me desmotiva, el
    estudiar ingeniera de sistemas si fue algo que lo pens, ya que desde nio
    siempre mire con curiosidad la tecnologa, mis padres tuvieron un internet
    cuando yo era pequeo y a veces incluso vea a mi papa con las computadoras
    en secciones de cdigo, eso solo me aumento mi curiosidad por saber de este
    mundo, me gustan las matemticas, informtica y algo de fsica, adems que
    casi a todos de esta carrera, tambin me gustan los videojuegos, as que
    eso igualmente afecto a mi decisin <span
    style='mso-spacerun:yes'></span>que al ver que esta carrera tenia todo eso
    fue que la escog.<o:p></o:p></span></p>
    </div>

   </tr>
